import '../../styles/App.css';
import Footer from '../Footer';

export default function Contact() {
  return(
    <>
    <div>
        <h2>Développeurs :</h2>
        <h4>Sébastien GUIDEZ   </h4>
        <h4>Github : guidezSeb</h4>
        <h4>Téléphone : 06.12.93.33.26</h4><br/>
        <h4>Nicolas LEPINETTE</h4>
        <h4>Github : NicolasLepinette</h4>
        <h4>Téléphone : 06.41.84.71.58</h4><br/>

    </div>
    <Footer/>
    </>
   );
}
